class win{
    constructor(n){
        this.winNum=n?n:'获取失败'
    }
    init() {
        var not_msg = document.createElement('div');
        not_msg.className = 'not_msg';
        $(not_msg).append('<div class="win_glass"> <span class="winNum">'+ this.winNum+'</span><p class="winBtn"></p> <img class="winImg" src="data:image/png;base64," alt=""></div>')
        $('body').append(not_msg);

        $(document).on('click', '.winBtn', function () {
            $('.not_msg').remove();
        });
    }
}

